-- All items whose filterID changes, let's make sure the RWP filter knows about it!
for itemID,f in pairs(ITEM_FILTERS_FOR_CLASSIC) do
	local retailF = ITEM_FILTERS_FOR_RETAIL[itemID];
	if retailF and f ~= retailF then
		if retailF == MAIL or retailF == PLATE then
			-- Whitelisted, write these always
			Items[itemID] = { filterForRWP = retailF };
		elseif retailF == COSMETIC and (f == SHIRTS or f == MISC or f == CLOTH) then
			-- Oh nice, Blizzard made Shirts Cosmetic. That's neat.
			Items[itemID] = { filterForRWP = retailF };
		elseif retailF == BATTLE_PETS and (f == HOLIDAY_ITEMS) then
			-- Oh nice, Blizzard made certain holiday items into battle pets. That's neat.
			Items[itemID] = { f = retailF };
		elseif (retailF == DAGGERS or retailF == ONE_HANDED_SWORDS or retailF == ONE_HANDED_MACES or retailF == ONE_HANDED_AXES or retailF == FIST_WEAPONS) and f == HELD_IN_OFF_HAND then
			-- These items got picked up as Off-Hand Items, which aren't a thing that needs separate filtering.
			-- In this case just straight up update the filter directly, we don't care about the base filter.
			Items[itemID] = { f = retailF };
		elseif f == COSMETIC then
			-- These items got changed from Cosmetics to something more specific... sadge.
			-- In this case just straight up update the filter directly, we don't care about the base filter.
			Items[itemID] = { f = retailF };
		elseif retailF == QUEST_ITEMS or retailF == LIBRAMS or retailF == FACTION_ITEMS or retailF == CONSUMABLES or retailF == REAGENTS or retailF == PROFESSION_EQUIPMENT then
			-- Blacklisted, we don't care about this.
		else
			-- HUH?! WHAT IS THIS? (maybe COSMETIC?)
			print("ITEM FILTERS FOR RWP: " .. itemID .. ", " .. f .. " -> " .. retailF);
			Items[itemID] = { filterForRWP = retailF };
		end
	end
end


